    startTime: "",
    endTime: "",
    postType: "",
    category: "",
    description: ""
  };

  render() {
    return (
      <form onSubmit={this.handleSubmit}>
        <label htmlFor="title">Title: </label>
        <input type="text" 
        name="title"
        id="title"

         />
      </form>
    );
  }
}

export default NewPost;
